from trijicon:

Trijicon Acog 4x32 Scope Dual Ill Green .223 Ballistic Reticle 4.0 MOA. 223 Ballistic Reticle 4.0 MOA RMR Sight and TA51 Mount is adapted from the battlefields. US Forces have begun improving this proven Trijicon Riflescopes from ACOG series by adding a small red dot sight on top for close encounter missions. Trijicon has now created a similar model for the public the TA31F-RMR. The main Trijicon scope provides a dual-illuminated reticle using fiber optics and tritium for bright aiming point in any light condition. The ranging reticle allows for bullet drop compensation out to 800 meters without any manual adjustments.

it's been mounted for a year, fired with only a few times.  like new, no box (i think)
